const users = [
  {id: 1, name:'Alice'},
  {id: 2, name: 'Raj'},
  {id: 3, name: 'Rahul'}
];

const isLoggin = true;

function check() {
  if(isLoggin){
    <h1>Welcome</h1>
  }else {
    <h1>Please Login</h1>
  }
}



const List = () => {
  return (
    <>
    <ul>
    {users.map(user => (
      <li key={user.id}>{user.name}</li>
    ))}
    </ul>
    <check />
    </>
  );
}

export default List;
